import './Profile.css';
import Image1 from './Assets/img1.png';
import Image2 from './Assets/img2.png';
import Image3 from './Assets/img3.png';
import Image4 from './Assets/img4.png';
import Image5 from './Assets/img5.png';
import Image6 from './Assets/img6.png';
import Image7 from './Assets/img7.png';
import Image8 from './Assets/img8.png';
import PurpleBtn from '../Button/PurpleButton';

function Profile(){
    return (
        <div className="Profile">
            <div className="ProductInfo">
                <h2>REELM SEED OIL</h2>
                <p>When your skin’s oil glands go into overdrive, they leave behind a slick, waxy substance called sebum. <br />A serum may be able to help give your skin care routine a boost, controlling oil and offering a few <br />added benefits along the way. We’ve put together this list of the best skin serums for oily skin to give <br />you a glow you can feel good about.</p>
            </div>

            <div className="image-gallery">
                <img className="" src={Image1} />
                <img className="" src={Image2} />
                <img className="" src={Image3} />
                <img className="" src={Image4} />
                <img className="" src={Image5} />
                <img className="" src={Image6} />
                <img className="" src={Image7} />
                <img className="" src={Image8} />
            </div>

            <PurpleBtn />

        </div>
    );
}

export default Profile;
